import React, { Component } from 'react'

export default class Footer extends Component {
    render() {
        return (
            <div>
                <footer class="footer">
                    <div class="content has-text-centered">
                        <p>
                        <strong>Dog-API</strong> by <a href="https://github.com/ankitsinghwakefit">Ankit Singh</a>. The source code is licensed
                        <a href="http://opensource.org/licenses/mit-license.php"> GitHub </a>. The website content
                        is licensed <a href="https://github.com/ankitsinghwakefit/Dog-api">CC BY NC SA 4.0</a>.
                        </p>
                    </div>
                </footer>
            </div>
        )
    }
}
